(35, 'Consulta o que fazer agora', 6, 0, 1, 4, '2012-04-23 13:00:00', 1, 24, 0, '2012-04-24 12:00:00', 0, 0, 100, 'A pergunta completa seria:\r\n"O que o usuÃ¡rio X deve fazer agora no projeto Y, seja para adiantar tarefas, fazer tarefas que estÃ£o no prazo ou tarefas atrasadas?"\r\n\r\nPortanto, a consulta deve trazer tarefas que:\r\n- sejam do projeto Y e estejam atribuÃ­das ao usuÃ¡rio X\r\n- tenham as menores datas iniciais e\r\n- nÃ£o tenham sido terminadas\r\n\r\nNÃ£o importa se jÃ¡ tenham ou nÃ£o trabalho registrado.', '0.00', '', 4, 0, 0, 0, 0, 0, '0', '', NULL, 0),
