(41, 'Atividades relacionadas ao OpenGoo', 6, 0, 1, 2, '2012-04-11 16:30:00', 5, 24, 0, '2012-04-18 15:00:00', 0, 0, 100, 'No inÃ­cio deste projeto, a ferramenta de gestÃ£o de projetos era o Opengoo. A partir de meados de maio, foi adotado o Dotproject. As tarefas feitas para Opengoo tomaram um tempo que estÃ¡ representado pela presente atividade.', '0.00', '', 2, 0, 0, 31, 0, 0, '0', '', NULL, 0),
