INSERT INTO `dotp_task_log` (`task_log_id`, `task_log_task`, `task_log_name`, `task_log_description`, `task_log_creator`, `task_log_hours`, `task_log_date`, `task_log_costcode`, `task_log_problem`, `task_log_reference`, `task_log_related_url`) VALUES
(2, 2, 'ReuniÃ£o 2012-04-11', 'A ata desta reuniÃ£o estÃ¡ nos arquivos do projeto\nEmailed 18/04/2012 15:47:45 to:\ngbozjr@tecpar.br (Geraldo Boz Junior)\n', 2, 2, '2012-04-18 15:45:59', '', 0, 0, ''),
(4, 6, 'Construir agente de monitoramento de projetos', 'Pronto o cÃ³digo para tarefas em andamento.', 2, 16, '2012-04-18 16:30:02', '', 0, 0, NULL),
(5, 10, 'Consulta para atividades em andamento', 'AdaptaÃ§Ã£o para Dotproject da consulta existente para o Opengoo :\r\n\r\nselect\r\n	dotp_projects.project_name as projeto,\r\n	dotp_tasks.task_name as atividade_em_andamento,\r\n	dotp_contacts.contact_order_by as responsavel,\r\n	dotp_tasks.task_end_date as data_encerramento\r\nfrom dotp_projects, dotp_tasks, dotp_task_log, dotp_contacts, dotp_users\r\nwhere\r\n	-- informa o projeto\r\n	dotp_projects.project_id = ''1'' and\r\n	-- associa Ã s atividades do projeto\r\n	dotp_projects.project_id = dotp_tasks.task_project and\r\n	-- atividades com menos que 100% de completude...\r\n	dotp_tasks.task_percent_complete < ''100'' and\r\n	-- ...e que tenham algum registro de trabalho\r\n	dotp_tasks.task_id = dotp_task_log.task_log_task and\r\n	-- associa ao responsÃ¡vel pela tarefa\r\n	dotp_tasks.task_owner = dotp_users.user_id and\r\n	dotp_users.user_contact = dotp_contacts.contact_id', 2, 2, '2012-04-19 16:08:29', '', 0, 0, ''),
(6, 47, 'CSCW-TECPAR versÃ£o1', 'Primeira versÃ£o do projeto CSCW-TECPAR no Dotproject', 1, 8, '2012-04-20 16:28:45', '', 0, 0, ''),
(7, 35, 'Consulta SQL para', 'select\r\n	dotp_contacts.contact_first_name as nome,\r\n	dotp_contacts.contact_last_name as sobrenome,\r\n	dotp_projects.project_name as projeto,\r\n	dotp_tasks.task_name as o_que_fazer_agora,\r\n	dotp_user_tasks.perc_assignment as perc_dedicaÃ§Ã£o,\r\n	dotp_tasks.task_percent_complete as percentagem_completa,\r\n	dotp_tasks.task_start_date as inicio_planejado\r\nfrom\r\n	dotp_contacts, dotp_projects, dotp_tasks,\r\n	dotp_users, dotp_user_tasks\r\nwhere\r\n	-- define the user and relate it to the respective contact\r\n	dotp_users.user_id = ''2''\r\n	and dotp_users.user_contact = dotp_contacts.contact_id\r\n	-- define the project\r\n	and dotp_projects.project_id = ''1''\r\n	-- only tasks of that project\r\n	and dotp_tasks.task_project = dotp_projects.project_id\r\n	-- that are not completed\r\n	and dotp_tasks.task_percent_complete < ''100''\r\n	-- and that are not dynamic tasks (macroatividades)\r\n	and dotp_tasks.task_dynamic <> ''1''\r\n	-- and only tasks assigned to that user\r\n	and dotp_user_tasks.task_id = dotp_tasks.task_id\r\n	and dotp_user_tasks.user_id = dotp_users.user_id\r\norder by dotp_tasks.task_start_date asc\r\n\r\n-----------------\r\nPara fazer uma consulta genÃ©rica (para todos os usuÃ¡rios de um projeto) , retirar a linha [dotp_users.user_id = ''2''] e fazer os ajustes (retirar ands)\r\n\r\nPara fazer uma consulta genÃ©rica (para todos os projetos de um usuÃ¡rio), retiar a linha [	and dotp_projects.project_id = ''1''] e fazer os ajustes (retirar ands)', 2, 4, '2012-04-23 13:33:21', '', 0, 0, ''),
(8, 30, 'Consulta final atrasado', '-- comentando ou usando as linhas que definem o usuÃ¡rio e o projeto, Ã© possÃ­vel descobrir:\r\n-- *todas as atividades atrasadas de um projeto (de qualquer usuÃ¡rio)\r\n-- *todas as atividades atrasadas de um usuÃ¡rio (em qualquer projeto) ou\r\n-- *as atividades atrasadas do usuÃ¡rio X no projeto Y\r\n-- ------------------------------------------------------------------------------------------------\r\nselect\r\n	dotp_tasks.task_name as atividade_que_ja_devia_ter_terminado,\r\n	dotp_projects.project_name as projeto,\r\n	dotp_contacts.contact_first_name as responsavel_nome,\r\n	dotp_contacts.contact_last_name as responsÃ¡vel_sobrenome,\r\n	dotp_tasks.task_end_date as final_planejado,\r\n	dotp_tasks.task_percent_complete as andamento_registrado\r\nfrom\r\n	dotp_tasks, dotp_projects, dotp_contacts,\r\n	dotp_user_tasks, dotp_users\r\nwhere\r\n	-- define o projeto\r\n	dotp_projects.project_id = ''1'' -- usar/comentar esta linha\r\n	-- associa tarefas do projeto...\r\n	and dotp_projects.project_id =  dotp_tasks.task_project\r\n	-- ... cuja data final jÃ¡ tenha passado...\r\n	and dotp_tasks.task_end_date < now()\r\n	-- ... e que ainda nÃ£o estejam completas\r\n	and dotp_tasks.task_percent_complete < ''100''\r\n	-- associa ao responsÃ¡vel\r\n	and dotp_users.user_id = ''2'' -- usar/comentar esta linha\r\n	and dotp_user_tasks.task_id = dotp_tasks.task_id\r\n	and dotp_user_tasks.user_id = dotp_users.user_id\r\n	and dotp_users.user_contact = dotp_contacts.contact_id\r\norder by dotp_tasks.task_end_date asc', 2, 2, '2012-04-24 14:33:31', '', 0, 0, NULL),
(9, 38, 'Consulta prazo encerrando em breve', '-- comentando ou usando as linhas que definem o usuÃ¡rio, o projeto ou o prazo, Ã© possÃ­vel descobrir: \r\n-- *todas as atividades cujo prazo estÃ¡ por encerrar no projeto X (de qualquer usuÃ¡rio) \r\n-- *todas as atividades atribuÃ­das ao usuÃ¡rio Y que estÃ£o por encerrar (em qualquer projeto) ou \r\n-- *as atividades atribuÃ­das ao usuÃ¡rio Y que estÃ£o por encerrar no projeto X \r\n\r\n-- NOTAR que esta busca nÃ£o mostra tarefas que jÃ¡ deviam ter terminado nem as que jÃ¡ terminaram\r\n-- ------------------------------------------------------------------------------------------------ \r\nselect \r\ndotp_tasks.task_name as atividade_por_encerrar, \r\ndotp_projects.project_name as projeto, \r\ndotp_contacts.contact_first_name as responsavel_nome, \r\ndotp_contacts.contact_last_name as responsÃ¡vel_sobrenome, \r\ndotp_tasks.task_end_date as final_planejado, \r\ndotp_tasks.task_percent_complete as andamento_registrado \r\nfrom \r\ndotp_tasks, dotp_projects, dotp_contacts, \r\ndotp_user_tasks, dotp_users \r\nwhere \r\n-- define o projeto \r\ndotp_projects.project_id = ''1''               -- usar/comentar esta linha \r\n-- associa tarefas do projeto... \r\nand dotp_projects.project_id = dotp_tasks.task_project \r\n-- cuja data final esteja entre agora (a tarefa nÃ£o estÃ¡ atrasada)\r\nand dotp_tasks.task_end_date > now()\r\n-- ... e os prÃ³ximos 3 dias (parÃ¢metro alterÃ¡vel)\r\nand dotp_tasks.task_end_date < now()+3*86400 -- n x 86400 onde n Ã© o nÃºmero de dias\r\n-- ... e que ainda nÃ£o estejam completas \r\nand dotp_tasks.task_percent_complete < ''100''\r\n-- associa ao responsÃ¡vel \r\nand dotp_users.user_id = ''2''                 -- usar/comentar esta linha \r\nand dotp_user_tasks.task_id = dotp_tasks.task_id \r\nand dotp_user_tasks.user_id = dotp_users.user_id \r\nand dotp_users.user_contact = dotp_contacts.contact_id \r\norder by dotp_tasks.task_end_date asc', 2, 4, '2012-04-25 12:49:38', '', 0, 0, NULL),
(10, 31, 'Consulta inicio atrasado', '-- comentando ou usando as linhas que definem o usuÃ¡rio, o projeto ou o prazo, Ã© possÃ­vel descobrir: \r\n-- *todas as atividades cujo inÃ­cio estÃ¡ atrasado no projeto X (de qualquer usuÃ¡rio) \r\n-- *todas as atividades atribuÃ­das ao usuÃ¡rio Y cujo inÃ­cio estÃ¡ atrasado (em qualquer projeto) ou \r\n-- *as atividades atribuÃ­das ao usuÃ¡rio Y no projeto X, cujo inÃ­cio estÃ¡ atrasado\r\n-- ------------------------------------------------------------------------------------------------ \r\nselect \r\ndotp_tasks.task_name as atividade_com_inicio_atrasado, \r\ndotp_projects.project_name as projeto, \r\ndotp_contacts.contact_first_name as responsavel_nome, \r\ndotp_contacts.contact_last_name as responsÃ¡vel_sobrenome, \r\ndotp_tasks.task_start_date as inicio_planejado\r\nfrom \r\ndotp_tasks, dotp_projects, dotp_contacts, \r\ndotp_user_tasks, dotp_users \r\nwhere \r\n-- define o projeto \r\ndotp_projects.project_id = ''1''               -- usar/comentar esta linha \r\n-- associa tarefas do projeto... \r\nand dotp_projects.project_id = dotp_tasks.task_project \r\n-- cuja data inicial seja anterior a agora\r\nand dotp_tasks.task_start_date < now()\r\n-- ... e que ainda nÃ£o tenha trabalho registrado\r\nand dotp_tasks.task_percent_complete = ''0''\r\n-- associa ao responsÃ¡vel \r\nand dotp_users.user_id = ''2''                 -- usar/comentar esta linha \r\nand dotp_user_tasks.task_id = dotp_tasks.task_id \r\nand dotp_user_tasks.user_id = dotp_users.user_id \r\nand dotp_users.user_contact = dotp_contacts.contact_id \r\norder by dotp_tasks.task_start_date asc', 2, 1, '2012-04-25 13:29:40', '', 0, 0, NULL),
(11, 12, 'Consulta projetos inativos', 'select distinct\r\ndotp_projects.project_name as projeto_inativo \r\nfrom \r\ndotp_projects\r\nwhere \r\n-- seleciona projetos que nÃ£o sejam os que tem atividade em andamento\r\ndotp_projects.project_id NOT IN\r\n(\r\n	-- seleciona projetos que tenham atividade em andamento\r\n	select distinct\r\n	dotp_projects.project_id\r\n	from\r\n	dotp_tasks, dotp_projects\r\n	where\r\n	dotp_tasks.task_percent_complete > ''0''\r\n	and dotp_tasks.task_percent_complete < ''100''\r\n)\r\norder by dotp_projects.project_name asc', 2, 1, '2012-04-25 14:27:57', '', 0, 0, NULL);
